using SerpentCore.Core;
using SerpentCore.Core.Managers;
using SerpentCore.Core.UI.QuickMenu;
using Serpent.Loader;
using System;
using System.IO;
using TMPro;
using UnityEngine;
using UnityEngine.UI;

namespace Serpent.Components
{
    internal class AresThemeComponent : ModComponent
    {
        private static ConfigValue<bool> _aresThemeEnabled;
        private ReMenuToggle _aresThemeToggle;
        private static ConfigValue<bool> _customImageEnabled;
        private ReMenuToggle _customImageToggle;
        private const string Base64BackgroundDefault = "";
        private const string Base64Icon = "";
        private static string _base64Background;
        public static bool SetTheme;
        public static bool firstRun = true;
        private static Sprite _qmBackground;
        private static Sprite _smcBackground;

        public static string ImageToBase64(string imagePath)
        {
            if (!File.Exists(imagePath)) return null;
            try
            {
                byte[] imageArray = System.IO.File.ReadAllBytes(imagePath);
                return Convert.ToBase64String(imageArray);
            }
            catch { ReLogger.Msg("Error in image processing."); }
            return null;
        }

        public AresThemeComponent()
        {
            _aresThemeEnabled = new ConfigValue<bool>(nameof(_aresThemeEnabled), true);
            _aresThemeEnabled.OnValueChanged += () => _aresThemeToggle.Toggle(_aresThemeEnabled);

            _customImageEnabled = new ConfigValue<bool>(nameof(_customImageEnabled), false);
            _customImageEnabled.OnValueChanged += () => _customImageToggle.Toggle(_customImageEnabled);
        }

        public override void OnUiManagerInit(UiManager uiManager)
        {
            base.OnUiManagerInit(uiManager);

            var subMenu = uiManager.MainMenu.GetMenuPage(Page.PageNames.Theme);
            _aresThemeToggle = subMenu.AddToggle("Custom Theme",
                "Enable The custom ARES theme", ToggleTheme,
                _aresThemeEnabled);
            _customImageToggle = subMenu.AddToggle("Custom Image",
                "Enable The custom ARES theme", CustomTheme,
                _customImageEnabled);
        }

        public override void OnUpdate()
        {
            SetThemeStyle();
        }

        public void ToggleTheme(bool value)
        {
            _aresThemeEnabled.SetValue(value);
            if (_aresThemeEnabled && !_customImageEnabled)
            {
                _base64Background = Base64BackgroundDefault;
                DisableTheme();
                SetThemeStyle();
            }
            else if (_aresThemeEnabled && _customImageEnabled)
            {
                _base64Background = ImageToBase64($"{Path.Combine(Environment.CurrentDirectory, "ARES/Background.png")}");
                if (_base64Background == null)
                {
                    ReLogger.Msg("No custom background image found");
                    Serpent.LogDebug("No custom background image found");
                    _base64Background = Base64BackgroundDefault;
                }
                DisableTheme();
                SetThemeStyle();
            }
            else if (!_aresThemeEnabled)
            {
                DisableTheme();
            }
        }

        public void CustomTheme(bool value)
        {
            _customImageEnabled.SetValue(value);
            if (_aresThemeEnabled && _customImageEnabled)
            {
                _base64Background = ImageToBase64($"{Path.Combine(Environment.CurrentDirectory, "ARES/Background.png")}");
                if (_base64Background == null)
                {
                    ReLogger.Msg("No custom background image found");
                    Serpent.LogDebug("No custom background image found");
                    _base64Background = Base64BackgroundDefault;
                }
                DisableTheme();
                SetThemeStyle();
            }
            else if (_aresThemeEnabled && !_customImageEnabled)
            {
                _base64Background = Base64BackgroundDefault;
                DisableTheme();
                SetThemeStyle();
            }
            else if (!_aresThemeEnabled)
            {
                DisableTheme();
            }
        }

        private static void SetThemeStyle()
        {
            try
            {
                if (firstRun)
                {
                    _qmBackground = GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/BackgroundLayer01").GetComponent<Image>().sprite;
                    _smcBackground = GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMNotificationsArea/Header_StreamerMode/Header/LeftItemContainer/Icon").GetComponent<Image>().sprite;
                    Console.WriteLine("Grabbed og back");
                    firstRun = false;
                }

                if (SetTheme || !_aresThemeEnabled) return;             
                if (_customImageEnabled)
                {
                    _base64Background = ImageToBase64($"{Path.Combine(Environment.CurrentDirectory, "ARES/Background.png")}");
                    if (_base64Background == null)
                    {
                        ReLogger.Msg("No custom background image found");
                        Serpent.LogDebug("No custom background image found");
                        _base64Background = Base64BackgroundDefault;
                    }
                }
                if (string.IsNullOrEmpty(_base64Background))
                {
                    _base64Background = Base64BackgroundDefault;
                }

                GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/BackgroundLayer01").GetComponent<Image>().sprite = CreateSpriteFromBase64(_base64Background);
                GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/Menu_Dashboard/ScrollRect/Viewport/VerticalLayoutGroup/Header_QuickLinks/LeftItemContainer/Text_Title").active = false;
                GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/Menu_Dashboard/ScrollRect/Viewport/VerticalLayoutGroup/Header_QuickActions/LeftItemContainer/Text_Title").active = false;
                GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMNotificationsArea/Header_StreamerMode/Header/LeftItemContainer/Icon").GetComponent<Image>().sprite = CreateSpriteFromBase64(Base64Icon);

                SetTheme = true;
            }
            catch
            {
            }
        }

        private static void DisableTheme()
        {
            GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/Menu_Dashboard/Header_H1/LeftItemContainer/Text_Title").GetComponent<TextMeshProUGUI>().color = Color.white;
            GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/Menu_Dashboard/ScrollRect/Viewport/VerticalLayoutGroup/Header_QuickLinks/LeftItemContainer/Text_Title").active = true;
            GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/Menu_Dashboard/ScrollRect/Viewport/VerticalLayoutGroup/Header_QuickActions/LeftItemContainer/Text_Title").active = true;
            SetTheme = false;
            GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMParent/BackgroundLayer01").GetComponent<Image>().sprite = _qmBackground;
            GameObject.Find("UserInterface/Canvas_QuickMenu(Clone)/Container/Window/QMNotificationsArea/Header_StreamerMode/Header/LeftItemContainer/Icon").GetComponent<Image>().sprite = _smcBackground;

        }

        private static Sprite CreateSpriteFromBase64(string data)
        {
            Texture2D texture2D = CreateTextureFromBase64(data);
            Rect rect = new Rect(0f, 0f, texture2D.width, texture2D.height);
            Vector2 pivot = new Vector2(0.5f, 0.5f);
            Vector4 border = Vector4.zero;
            return Sprite.CreateSprite_Injected(texture2D, ref rect, ref pivot, 100f, 0u, SpriteMeshType.Tight, ref border, generateFallbackPhysicsShape: false);
        }

        private static Texture2D CreateTextureFromBase64(string data)
        {
            Texture2D texture2D = new Texture2D(2, 2);
            ImageConversion.LoadImage(texture2D, Convert.FromBase64String(data));
            texture2D.hideFlags |= HideFlags.DontUnloadUnusedAsset;
            return texture2D;
        }


    }
}
